---criando a tabela cliente1
  
CREATE TABLE "cliente1" (
  codigoCliente int primary key ,
  nome varchar(50),
  sobrenome varchar(50),
  sexo varchar(10),
  dataNascimento date,
  cidade varchar(100),
  lugar varchar(100),
  email varchar(100),
  telefone varchar(10)
);



